    <div className="app">
      <h1>Test</h1>
      <Clock />
      <div className="question-container">
        <h1>Type: {jsonData.type}</h1>
        <h1>Question: {jsonData.question}</h1>
        <div className="options-container">
          {jsonData.options.map((option, index) => (
            <OptionButton
